import React from 'react';
import { GoogleMap, withScriptjs, withGoogleMap } from 'react-google-maps';

function Map() {
  return (
    <GoogleMap
      defaultZoom={10}
      defaultCenter={{
        lat: 53.837646,
        lng: 27.568144,
      }}
    />
  );
}

export const WrappedMap = withScriptjs(withGoogleMap(Map));
